import './App.css';

function App() {
  function headerInput(variable) {
    if (variable) {
      return "Image was clicked";
    } else {
      return "Image has not been clicked";
    }
  }
  function imageClickHandle() {
    return headerInput()
  };
  return (

    <div>
      <>
        <img src="/images/campus_map_half.png" onClick={imageClickHandle()} alt="" />
        <h2>{headerInput(false)}</h2>
    </>
    </div>
  );
}

export default App;
